(9, 'Eng Workload', 'Crear grafica de Week Workload por ingeniero\r\n', '2023-03-17 00:00:00', '2023-03-21 00:00:00', '2023-03-21 00:00:00', 10, NULL, 4, 4, 6, '2023-03-07 00:00:00'),
(10, 'Eng Workload', 'Crear grafica de Week Worload por departamento\r\n', '2023-03-22 00:00:00', '2023-03-23 00:00:00', '2023-03-23 00:00:00', 7, NULL, 4, 4, 6, '2023-03-07 00:00:00'),
(11, 'Create Service page', 'Page to create new type of services\r\n', '2023-03-23 00:00:00', '2023-03-23 00:00:00', '2023-03-23 00:00:00', 2, NULL, 4, 4, 6, '2023-03-06 00:00:00'),
(12, 'Create Requester page', 'Page to create new Application Project Requesters.', '2023-03-24 00:00:00', '2023-03-24 00:00:00', '2023-03-24 00:00:00', 2, NULL, 4, 4, 6, '2023-03-06 00:00:00'),
(13, 'Able to edit field requested date', 'Editar requested date de actividades\r\n', '2023-03-27 00:00:00', '2023-03-27 00:00:00', '2023-03-27 00:00:00', 2, NULL, 5, 4, 6, '2023-03-27 00:00:00'),
(14, 'Crear sistema de Tickets', 'Create page to administrate System Requirements (Tickets)\r\n', '2023-03-24 00:00:00', '2023-04-12 00:00:00', '2023-04-14 11:06:30', 30, 'Done with no issues', 7, 4, 6, '2023-02-24 00:00:00'),
(15, 'Add project Leader to Application Projects', 'Add option to enable a user as project leader', '2023-04-19 09:30:00', '2023-05-11 00:00:00', '2023-04-20 08:38:00', 2, 'Can toggle assign as project leader from Employee page', 4, 4, 6, '2023-04-10 00:00:00'),
(16, 'Crear Modulo de gestion de materiales alternativos', 'Add full module to manage and store alternative components to application team, add common user for everyone in NAI can consult current alternatives before request a new one', '2023-05-16 15:00:00', '2023-06-16 17:00:00', NULL, 120, '- Working on DB Design. - Base SQL Structure DB Created. - Working on migrating current data to DB Format. - Working on History Query Page.', 7, 2, 15, '2023-03-09 00:00:00'),
(25, 'PORCENTAJE DE COMPLETADO', 'Muestra 0% completado cuando ya esta 100%\n En la pagina de DETAIL ACTIVITY de Applications', '2023-04-17 09:30:00', '2023-04-17 00:00:00', '2023-04-19 07:53:00', 1, 'Fixed', 1, 4, 6, '2023-04-14 11:20:21'),
(26, 'INFORMACION DUPLICADA', 'Affected Page:\n                         AE-MEDIUM-47', '2023-04-21 15:00:00', '2023-04-21 00:00:00', '2023-04-21 15:40:00', 1, 'Done', 1, 4, 6, '2023-04-20 10:14:22'),
(27, 'LOG DE SOPORTE', 'Affected Page:\nFavor de crear un log especificamente para el soporte de tooling y alternativos.', '2023-04-21 14:04:00', '2023-04-21 00:00:00', '2023-04-24 10:26:00', 5, 'Added Support section to Open Log Page, and show projects with 10 hours or less', 4, 4, 6, '2023-04-21 08:01:53'),
(28, 'BARRA PROGRESO', 'Affected Page:\r\nOpen Log La barra del progreso de application no sirve.', '2023-04-27 08:00:00', '2023-04-27 19:00:00', '2023-04-27 16:24:00', 2, 'Fixed Issue', 1, 4, 6, '2023-04-21 15:27:07'),
(29, 'HORAS COE PROJECT DETAIL', 'Affected Page: PROJECT DETAIL COE                            HORAS MAL CALCULADAS EN LOS PROYECTOS DEL COE\n\n\n\n\n\n\n\n                         ', '2023-04-27 16:25:00', '2023-04-28 19:00:00', '2023-05-08 15:00:00', 2, 'Fixed hours based on selected project type.', 1, 4, 6, '2023-04-21 15:39:57'),
(30, 'ACTIVIDAD POR INGENIERO', 'Affected Page:  ACT PER ENG \nMuestra overdue actividades que ya se completaron.\n\n\n                         ', '2023-04-24 15:24:00', '2023-04-24 22:00:00', '2023-04-24 04:20:00', 1, 'Overdue Activities now refers to Aditional resuorces assigned oned, removed Inactive users.', 1, 4, 6, '2023-04-24 08:05:43'),
(31, 'Actualizar workload graphics', 'Affected Page:  Dashboard\nQuitar a Heriberto y Roberto\n                         ', '2023-04-24 15:45:00', '2023-04-24 23:00:00', NULL, 2, 'Those Graphics refers to active Users. Please update active status from each user in User\'s Page.', 1, 4, 6, '2023-04-24 10:54:33'),
(32, ' COE Projects Leader', 'Affected Page: Project detail\nNo puedo seleccionar a Felix / Eric como lider de un proyecto por que estan en otro dept.\n\n\n                         ', '2023-05-08 00:00:00', '2023-05-08 16:00:00', '2023-05-08 15:16:00', 1, 'Added Assignable Designers who has position of Design and Application Supervisor on Employee.', 1, 4, 6, '2023-05-03 11:14:43'),
(33, 'Actividades Fco', 'Affected Page: Profile\nNo le aparecen las actividades que se le asignaron\n                         ', '2023-05-08 10:00:00', '2023-05-08 11:41:00', '2023-05-08 14:35:00', 2, 'Fixed issue', 1, 4, 6, '2023-05-03 11:15:35'),
(34, 'CAMBIAR HORAS MANUALMENTE', 'Affected Page: PROJECT DETAIL\n\nSe requiere poder cambiar las horas ya establecidas de los proyectos manualmente cuando se requiera.\n                         ', '2023-05-09 07:30:00', '2023-05-09 10:00:00', '2023-05-09 08:30:00', 2, 'Added Option to increase hours by oveload field on project detail.', 4, 4, 6, '2023-05-04 07:51:06'),
(35, 'AGREGAR PRIORITY & AWARDED APP PROJECTS', 'Affected Page: PROJECT DETAIL \nAgregar los los botones de Priority & Awarded para los proyectos de Application.\n\n\n                         ', '2023-05-09 11:00:00', '2023-05-09 05:00:00', '2023-05-09 16:19:00', 5, 'Done', 4, 4, 6, '2023-05-04 10:53:57'),
(36, 'DUE DATE', 'Affected Page:  Project Detail / Activities\n\nDue date aparece como 5/4 en las actividades... y en el project detail tiene la fecha de 5/5\n \n\n                         ', '2023-05-08 15:30:00', '2023-05-08 16:00:00', '2023-05-08 16:00:00', 1, 'Project due date is independently from activities due date', 1, 4, 6, '2023-05-08 10:19:44'),
(37, 'Agregar Horas', 'Affected Page: Application History\nFavor de agregar la horas en el historial de aplicaciones.\n                         ', '2023-05-16 14:47:00', '2023-05-16 17:00:00', '2023-05-16 14:59:00', 1, 'Added hours field in history', 4, 4, 6, '2023-05-11 07:21:47'),
(38, 'WRONG PROJECT NAME', 'Affected Page: ACT PER ENG\nEn las actividades Over due de Felix aparece Application 172 en ligar del nombre del proyecto y la liga no te lleva al proyecto.\n                         ', '2023-05-16 11:43:00', '2023-05-16 17:00:00', '2023-05-16 14:45:00', 1, 'Fixed name display and correct link to projects', 1, 4, 6, '2023-05-15 10:44:05'),
(39, 'RECURSOS DE COE Y APPLICATIONS', 'Affected Page:  Project Detail\nHabilitar todos los recursos para que puedan ser asgnados a cualquier actividad. Juntar COE Y applicartions\n                        ', '2023-05-16 08:00:00', '2023-05-16 10:00:00', '2023-05-16 10:53:00', 1, 'Added COE & Application teams to be assignable on activities.', 1, 4, 6, '2023-05-15 16:41:37'),
(40, 'Suma de horas overload', 'Affected Page: Dashboard / Workload per engineer\nLa cantidad reflejada en la grafica de Workoad per engineer no tiene incluidas las horas overload que se le agregan al proyecto.\n\n                         ', '2023-05-25 07:24:00', '2023-05-25 15:00:00', '2023-05-25 08:32:00', 1, 'Added Overload hrs to Application Workload Dashboard.', 1, 4, 6, '2023-05-22 16:07:41'),
(41, 'Tabla capacidad instalada', 'Affected Page: Dashboard\nCrear una tabla con la siguiente informacion:  Num de semana /  total de horas de las actividades que se registraron esa semana / Total horas de las actividades que se completaron esa semana.\n                         ', '2023-06-01 00:00:00', '2023-06-02 00:00:00', NULL, 8, 'Working on it', 4, 2, 6, '2023-05-31 07:38:09'),
(42, 'Asignación de recursos', 'Affected Page:\n No puedes autoasignar en los requerimientos mas de un dia. ', NULL, NULL, NULL, NULL, NULL, 1, 1, 2, '2023-06-01 10:27:04');
